import React from "react";

import { Container, ProductInfo } from "./styles";

function ProductCard(props) {
  return (
    <Container>
      <img src={props.imgsrc} />
      <ProductInfo>
        <PriceInfo>
          <h3>{props.price}</h3>
          <sub>
            <h4>{props.portion}</h4>
          </sub>
        </PriceInfo>
        <p>{props.title}</p>
        <sub>
          <a>{props.brand}</a>
        </sub>
      </ProductInfo>
    </Container>
  );
}

export default ProductCard;
